import { IonContent, IonHeader, IonPage, IonTitle, IonToolbar, IonList, IonItem, IonLabel, IonCheckbox, IonBadge, IonFab, IonFabButton, IonIcon } from '@ionic/react';
import React from 'react';
import {add} from 'ionicons/icons';


const NewTask: React.FC = () => {
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>ToDO List RESTful</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonContent>

        <IonList>
          <IonItem>
            <IonCheckbox slot="start" />

            <IonLabel>
              This is a not for example
            </IonLabel>
            <IonBadge color="warning" slot="end">
              Priority: 3
            </IonBadge>
          </IonItem>
        </IonList>

      </IonContent>

      <IonFab vertical="bottom" horizontal="end" slot="fixed">
        <IonFabButton>
          <IonIcon icon={ add } />
        </IonFabButton>
      </IonFab>

    </IonPage>
  );
};

export default NewTask;
